// SPDX-License-Identifier: GPL-3.0

pragma solidity ^0.6.12;

import "./IUniswapV2Router02.sol";
import { IERC20 } from "./Interfaces.sol";
import "./IWETH.sol";
import "./Withdrawable.sol";

contract arbContract2 is Ownable{

    struct TradeDirection{  
        uint directionNumber;
    }

    // IUniswapV2Router02 ape_router = IUniswapV2Router02(apeRouterAddress);
    // IERC20 usdc = IERC20(usdcAddress);
    // IWETH wmatic = IWETH(wmaticAddress);
    IUniswapV2Router02 ape_router;
    IERC20 usdc;
    IWETH wmatic;
    TradeDirection public tradeDirection;
    address beneficiary;

    event Received(address sender, uint amount);

    receive() external payable {
    emit Received(msg.sender, msg.value);
    }

    constructor(
        address apeAddress,
        address wmaticAddress,
        address usdcAddress,
        address beneficiaryAddress
    ) public {
        ape_router = IUniswapV2Router02(apeAddress);
        wmatic = IWETH(wmaticAddress);
        usdc = IERC20(usdcAddress);
        beneficiary = beneficiaryAddress;
    }

    function deposit() external payable {}   

    function Arbitrage(uint _direction) public payable onlyOwner{

    tradeDirection.directionNumber = _direction;
    uint256 usdcBalance = usdc.balanceOf(address(this));

    if (tradeDirection.directionNumber == 0){
            usdc.approve(address(ape_router), usdcBalance);
            address[] memory direction_ape = new address[] (2);
            direction_ape[0] = address(usdc);
            direction_ape[1] = address(wmatic);
            uint[] memory minOut_ape = ape_router.getAmountsOut(usdcBalance, direction_ape);
            uint minOut_ape1 = minOut_ape[0] * 9;
            uint minOut_ape2 = minOut_ape1 / 10;
            ape_router.swapExactTokensForETH(usdcBalance, minOut_ape2, direction_ape, address(this), now);

            // address[] memory direction_ape2 = new address[] (2);
            // direction_ape2[0] = wmaticAddress;
            // direction_ape2[1] = usdcAddress;
            // uint[] memory minOut_ape2 = ape_router.getAmountsOut(address(this).balance, direction_ape);
            // ape_router.swapExactETHForTokens{value: address(this).balance}(minOut_ape2[0], direction_ape2, address(this), now);
    } else {

    }
    }

    function withdrawToken(address _tokenContract, uint256 _amount) external onlyOwner {
    IERC20 tokenContract = IERC20(_tokenContract);
    tokenContract.transfer(msg.sender, _amount);
    }

    function withdrawAll(address _tokenAddress) external onlyOwner{
        IERC20 tokenContract = IERC20(_tokenAddress);
        uint256 totalBalance = tokenContract.balanceOf(address(this));
        tokenContract.transfer(msg.sender, totalBalance);
    }


}
